package components.caret;

import java.util.Vector;

import javax.swing.text.JTextComponent;

import bus.uigen.OEFrame;
import bus.uigen.uiFrame;
import bus.uigen.oadapters.ClassAdapter;
import bus.uigen.oadapters.ObjectAdapter;

public class CaretManager {
	private ObjectAdapter observerPropertyAdapter, observablePropertyAdapter;
	private Vector<ObjectAdapter> children;
	
	public CaretManager(uiFrame newFrame) {
		ClassAdapter adapter = (ClassAdapter) newFrame.getTopAdapter();
		children = adapter.getChildrenVector();
	}
	
	public void addCaretActionListener(String observablePropertyName, String observerPropertyName) {
		for (ObjectAdapter child : children) {
			if (child.getComponentName().equals(observablePropertyName)) {
				observablePropertyAdapter = child;
			}
			if (child.getComponentName().equals(observerPropertyName)) {
				observerPropertyAdapter = child;
			}
		}
		if (observablePropertyAdapter == null) {
			System.err.println("Observable Property not found");
			return;
		}
		if (observerPropertyAdapter == null) {
			System.err.println("Observer Property not found");
			return;
		}
		if (!(observablePropertyAdapter.getUIComponent().getPhysicalComponent() instanceof JTextComponent)) {
			System.err.println("Observable Component is not JTextComponent");
