package components.caret;

import javax.swing.event.CaretEvent;
import javax.swing.event.CaretListener;

import bus.uigen.OEFrame;
import bus.uigen.oadapters.ObjectAdapter;

public class CaretActionListener implements CaretListener{
	private OEFrame frame;
	private ObjectAdapter oa;
	
	public CaretActionListener(ObjectAdapter newObjectAdapter, OEFrame newFrame) {
		oa = newObjectAdapter;
		frame = newFrame;
	}

	@Override
	public void caretUpdate(CaretEvent evt) {
		oa.setValueOfAtomicOrPrimitive(evt.getDot());
		frame.refresh();
	}

}

